import Header from './Header';
import Nav from './Nav';
import RightMenu from './RightMenu';
import Content from './Content';
import Footer from './Footer';

function App() {
  return (
    <>
      <Header/>
      <div className="displayFlex">
        <Nav/>
        <Content/>
        <RightMenu/>
      </div>
      <Footer/>

    </>
  );
}

